import logo from './logo.svg';
import './App.css';
import FileUploadComponent from './Components/FileUploadComponent';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <FileUploadComponent />
      </header>
    </div>
  );
}

export default App;
